import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <MakeList />
    </div>
  );
}

function MakeList() {
  return allCountryScores
    .sort((a, b) => a.name.localeCompare(b.name))
    .map((element) => (
      <div>
        <h2>High Scores: {element.name}</h2>
        <ul>
          <li>
            {element.scores("n")} {element.scores}{" "}
          </li>
        </ul>
      </div>
    ));
}

export default App;
